。array 参数的值作为第一个，键名作为第二个。如果提供了可选参数 userdata ，将被作为第三个参数传递给回调函数。 如果 myfunction 函数需要的参数比给出的多，则每次 array_walk() 调用 myfunction 时都会产生一个 E_WARNING 级的错误。这些警告可以通过在 array_walk() 调用前加上 PHP 的错误操作符 @ 来抑制，或者用 error_reporting()。 注释：如果回调函数需要直接作用于数组中的值，可以将回调函数的第一个参数指定为引用：&amp;$value。（参见例子 3）注释：将键名和 userdata 传递到 myfunction 中是 PHP 4.0 新增加的。   正则邮箱 preg_match(&#39;/^[\\w\\-\\.]+@[\\w\\-]+(\\.\\w+)+$/&#39;, $email);</pre> <p>     <br/> </p>'  WHERE `pid`='26' 
